import Button from './components/Button';

function App() {

  const numbers = [7, 8, 9, 4, 5, 6, 1, 2, 3];
  const makeButtons = numbers.map(number => (
    <Button number={number} />
  ))

  return (
    <div className="App">
      <p>
        This is a calculator
      </p>
      {makeButtons}
    </div>
  );
}

export default App;
